Game::Game( MainWindow& wnd )
	:
	wnd( wnd ),
	gfx( wnd )
{
	Box.x = 0;
	Box.y = 0;
	Cat.x = gfx.ScreenWidth - Cat::width;
	Cat.y = gfx.ScreenHeight - Cat::height;
	std::random_device rd;
	std::mt19937 rng(rd());
	std::uniform_int_distribution<int> xDist(0, 770);
	std::uniform_int_distribution<int> yDist(0, 570);
	std::uniform_int_distribution<int> velocityDist(1, 5);
	std::uniform_int_distribution<int> runAwayDist(60 * 3, 60 * 20);
	std::uniform_int_distribution<int> colourDist(0, 255);

	Kitten0.x = xDist(rng);
	Kitten0.y = yDist(rng);
	Kitten0.vxRunAway = velocityDist(rng);
	Kitten0.vyRunAway = velocityDist(rng);
	Kitten0.vx = velocityDist(rng);
	Kitten0.vy = velocityDist(rng);
	Kitten0.RunAwayTime = runAwayDist(rng);
	Kitten0.accentR = colourDist(rng);
	Kitten0.accentG = Kitten0.accentG;
	Kitten0.accentB = Kitten0.accentG;
	Kitten0.mainR = colourDist(rng);
	Kitten0.mainG = Kitten0.mainR;
	Kitten0.mainB = Kitten0.mainR;

	Kitten1.x = xDist(rng);
	Kitten1.y = yDist(rng);
	Kitten1.vxRunAway = velocityDist(rng);
	Kitten1.vyRunAway = velocityDist(rng);
	Kitten1.vx = velocityDist(rng);
	Kitten1.vy = velocityDist(rng);
	Kitten1.RunAwayTime = runAwayDist(rng);
	Kitten1.accentR = colourDist(rng);
	Kitten1.accentG = Kitten1.accentR;
	Kitten1.accentB = Kitten1.accentR;
	Kitten1.mainR = colourDist(rng);
	Kitten1.mainG = Kitten1.mainR;
	Kitten1.mainB = Kitten1.mainR;

	Kitten2.x = xDist(rng);
	Kitten2.y = yDist(rng);
	Kitten2.vxRunAway = velocityDist(rng);
	Kitten2.vyRunAway = velocityDist(rng);
	Kitten2.vx = velocityDist(rng);
	Kitten2.vy = velocityDist(rng);
	Kitten2.RunAwayTime = runAwayDist(rng);
	Kitten2.accentR = colourDist(rng);
	Kitten2.accentG = Kitten2.accentR;
	Kitten2.accentB = Kitten2.accentR;
	Kitten2.mainR = colourDist(rng);
	Kitten2.mainG = Kitten2.mainR;
	Kitten2.mainB = Kitten2.mainR;

	Kitten3.x = xDist(rng);
	Kitten3.y = yDist(rng);
	Kitten3.vxRunAway = velocityDist(rng);
	Kitten3.vyRunAway = velocityDist(rng);
	Kitten3.vx = velocityDist(rng);
	Kitten3.vy = velocityDist(rng);
	Kitten3.RunAwayTime = runAwayDist(rng);
	Kitten3.accentR = colourDist(rng);
	Kitten3.accentG = Kitten3.accentR;
	Kitten3.accentB = Kitten3.accentR;
	Kitten3.mainR = colourDist(rng);
	Kitten3.mainG = Kitten3.mainR;
	Kitten3.mainB = Kitten3.mainR;
}

void Game::Go()
{
	gfx.BeginFrame();	
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::UpdateModel()
{
	if (isStarted && (Kitten0.InMouth == false || Kitten1.InMouth == false || Kitten2.InMouth == false))
	{
		
		Cat.update(wnd.kbd.KeyIsPressed(VK_RIGHT),
			wnd.kbd.KeyIsPressed(VK_LEFT),
			wnd.kbd.KeyIsPressed(VK_DOWN),
			wnd.kbd.KeyIsPressed(VK_UP));

		Kitten0.Update();
		Kitten1.Update();
		Kitten2.Update();
		Kitten3.Update();

		if (IsColliding(Cat.x, Cat.y, Cat::width, Cat::height, Kitten0.x, Kitten0.y, Kitten::width, Kitten::height) && Cat.hasKitten == false) {
			Kitten0.InMouth = true;
			Cat.hasKitten = true;
		}
		if (IsColliding(Cat.x, Cat.y, Cat::width, Cat::height, Kitten1.x, Kitten1.y, Kitten::width, Kitten::height) && Cat.hasKitten == false) {
			Kitten1.InMouth = true;
			Cat.hasKitten = true;
		}
		if (IsColliding(Cat.x, Cat.y, Cat::width, Cat::height, Kitten2.x, Kitten2.y, Kitten::width, Kitten::height) && Cat.hasKitten == false) {
			Kitten2.InMouth = true;
			Cat.hasKitten = true;
		}
		if (IsColliding(Cat.x, Cat.y, Cat::width, Cat::height, Kitten3.x, Kitten3.y, Kitten::width, Kitten::height) && Cat.hasKitten == false) {
			Kitten3.InMouth = true;
			Cat.hasKitten = true;
		}

		if (IsColliding(Cat.x, Cat.y, Cat::width, Cat::height, Box.x, Box.y, Box::width, Box::height)) {
			if (Kitten0.InMouth == true) {
				Kitten0.InMouth = false;
				Kitten0.InBed = true;
				Kitten0.x = Box.x + 3;
				Kitten0.y = Box.y + 3;
				Kitten0.vx = 0;
				Kitten0.vy = 0;
				Cat.hasKitten = false;
			}
			else if (Kitten1.InMouth == true) {
				Kitten1.InMouth = false;
				Kitten1.InBed = true;
				Kitten1.x = Box.x + 60-3-Kitten::width;
				Kitten1.y = Box.y + 3;
				Kitten1.vx = 0;
				Kitten1.vy = 0;
				Cat.hasKitten = false;

			}
			else if (Kitten2.InMouth == true) {
				Kitten2.InMouth = false;
				Kitten2.InBed = true;
				Kitten2.x = Box.x + 3;
				Kitten2.y = Box.y + Box::height - 3 - Kitten::height;
				Kitten2.vx = 0;
				Kitten2.vy = 0;
				Cat.hasKitten = false;

			}
			else if (Kitten3.InMouth == true) {
				Kitten3.InMouth = false;
				Kitten3.InBed = true;
				Kitten3.x = Box.x + Box::width - 3 - Kitten::width;
				Kitten3.y = Box.y + Box::height - 3 - Kitten::height;
				Kitten3.vx = 0;
				Kitten3.vy = 0;
				Cat.hasKitten = false;

			}
		}


		if (Kitten0.InBed == true || Kitten1.InBed == true || Kitten2.InBed == true || Kitten3.InBed == true) {
			if (Kitten0.InBed == true && Kitten1.InBed == true && Kitten2.InBed == true && Kitten3.InBed == true) {

			}
			else {
				if (Kitten0.InBed == true) {
					Kitten0.timeInBed++;
					if (Kitten0.timeInBed == Kitten0.RunAwayTime) {
						Kitten0.timeInBed = 0;
						Kitten0.InBed = false;
						Kitten0.vx = Kitten0.vxRunAway;
						Kitten0.vy = Kitten0.vyRunAway;

					}
				}
				if (Kitten1.InBed == true) {
					Kitten1.timeInBed++;
					if (Kitten1.timeInBed == Kitten1.RunAwayTime) {
						Kitten1.timeInBed = 0;
						Kitten1.InBed = false;
						Kitten1.vx = Kitten1.vxRunAway;
						Kitten1.vy = Kitten1.vyRunAway;
					}
				}
				if (Kitten2.InBed == true) {
					Kitten2.timeInBed++;
					if (Kitten2.timeInBed == Kitten2.RunAwayTime) {
						Kitten2.timeInBed = 0;
						Kitten2.InBed = false;
						Kitten2.vx = Kitten2.vxRunAway;
						Kitten2.vy = Kitten2.vyRunAway;
					}
				}
				if (Kitten3.InBed == true) {
					Kitten3.timeInBed++;
					if (Kitten3.timeInBed == Kitten3.RunAwayTime) {
						Kitten3.timeInBed = 0;
						Kitten3.InBed = false;
						Kitten3.vx = Kitten3.vxRunAway;
						Kitten3.vy = Kitten3.vyRunAway;
					}
				}
			}
		}


	}
	else if (Kitten0.InBed == true && Kitten1.InBed == true && Kitten2.InBed == true && Kitten3.InBed == true) {
		
	}
	else {

		if (wnd.kbd.KeyIsPressed(VK_RETURN)) {
			isStarted = true;
		}
	}
}

void Game::ComposeFrame()
{
	if (!isStarted) {
		DrawIntro();
	}
	else {
		DrawBox(0, 0);

		if (Kitten0.InMouth == false) {
			DrawKitten(Kitten0.x, Kitten0.y, Kitten0.facesLeft,
				Kitten0.mainR, Kitten0.mainG, Kitten0.mainB,
				Kitten0.accentR, Kitten0.accentG, Kitten0.accentB);
		}
		if (Kitten1.InMouth == false) {
			DrawKitten(Kitten1.x, Kitten1.y, Kitten1.facesLeft,
				Kitten1.mainR,   Kitten1.mainG,   Kitten1.mainB,
				Kitten1.accentR, Kitten1.accentG, Kitten1.accentB);
		}
		if (Kitten2.InMouth == false) {
			DrawKitten(Kitten2.x, Kitten2.y, Kitten2.facesLeft,
				Kitten2.mainR,   Kitten2.mainG,   Kitten2.mainB,
				Kitten2.accentR, Kitten2.accentG, Kitten2.accentB);
		}
		if (Kitten3.InMouth == false) {
			DrawKitten(Kitten3.x, Kitten3.y, Kitten3.facesLeft,
				Kitten3.mainR,   Kitten3.mainG,   Kitten3.mainB,
				Kitten3.accentR, Kitten3.accentG, Kitten3.accentB);
		}

		DrawCat(Cat.x, Cat.y, Cat.facesLeft, Cat.frameN);
		if (Kitten0.InBed == true && Kitten1.InBed == true && Kitten2.InBed == true && Kitten3.InBed == true) {
			DrawGameOver();
		}

		
	}
		
}

